import React from "react";
import Input from "../Common/Input";
import CommonButton from "../Common/CommonButton";
import { Link } from "react-router-dom";
import DataHelpers from "../../utils/dataHelpers";
import { useFormik } from "formik";
import { signUpSchema } from "../../utils/validationSchema";

const SignUp = () => {
	const formik = useFormik({
		initialValues: {
			name: "",
			email: "",
			password: "",
		},
		validationSchema: signUpSchema,
		onSubmit: handleSignUpUser,
	});
	return (
		<div className="formWrapper">
			<form>
				<h3>SignUp</h3>
				{DataHelpers.getSignUpInputs().map((inp) => (
					<div key={inp?.id}>
						<Input
							placeholder={inp?.placeHolder}
							label={inp?.lable}
							type={inp?.type}
						/>
					</div>
				))}
				{/* <Input placeholder={"Enter full name"} label={"Full Name"} />
				<Input placeholder={"Enter email"} label={"Email"} />
				<Input placeholder={"Enter password"} label={"Password"} /> */}
				<div className="buttonWrapper">
					<CommonButton text="Sign Up " />
				</div>
				<p>
					Already have account? Click here to <Link to="/">Signin</Link>
				</p>
			</form>
		</div>
	);
};

export default SignUp;
